import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Set viewport to desktop size to ensure consistent layout
    await page.setViewportSize({ width: 1280, height: 720 });

    // Navigate to the HTML file with domcontentloaded to avoid timeout
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click the Electronics category card
    await page.waitForSelector('div.category-card:has-text("Electronics")', { timeout: 5000 });
    await page.click('div.category-card:has-text("Electronics")');

    // Wait for category page to load and verify navigation
    await page.waitForSelector('h2:has-text("Electronics")', { timeout: 5000 });

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_electronics_category.png'));

    // Extract category name to verify success
    const categoryTitle = await page.textContent('h2:has-text("Electronics")');

    return {
      success: true,
      action: "Navigated to Electronics category successfully",
      extractedData: {
        category: categoryTitle.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Electronics category",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
